script: |
  super -f text -I q5112.spq | sort > q5112.out

inputs:
  - name: q5112.spq
    data: |
      SELECT DISTINCT + col0 FROM tab2 (FORMAT parquet) WHERE ( - - ( + col0 ) * col2 - ( ( - + 46 ) ) + - col0 + 20 + - - col0 / col2 ) <> col0;
  - name: tab2

outputs:
  - name: q5112.out
    data: |
      46
      64
      75
